import React from 'react';
import NavigationBar from '../components/NavigationBar';

const LoggedInPage = () => {
    return(
        <div>
            <NavigationBar />
          <br/>  <h1> Logged In </h1> <br/>
          <p> You are logged in. Idk what's here yet. </p>
        </div>

    );
};

export default LoggedInPage;
